var hashValueGetter = function (params) {
    return params.node ? params.node.rowIndex : null;
};

function createRowData() {
    var rowData = [];
    for (var i = 0; i < 100; i++) {
        rowData.push({
            a: Math.floor(i % 4),
            b: Math.floor(i % 7)
        });
    }
    return rowData;
}
